import { View } from 'react-native';
import Heading from "../components/Heading";
import AppButton from "../components/AppButton";
import styles from "../styles/ViewStyle"

const CountryResult = ({navigation, route}) => {
    return (
        <View style={styles.viewContainer}>
          {/* Add api call results to text props of heading and buttons */}
          <Heading   text={route.params.cities[0]} />
          <AppButton text={route.params.cities[0]} onPress={() => navigation.navigate("CityResults")} />
          <AppButton text={route.params.cities[1]}  onPress={() => navigation.navigate("CityResults")} />
          <AppButton text={route.params.cities[2]}  onPress={() => navigation.navigate("CityResults")} />
       </View>
    )
  }
  export default CountryResult;
